import React from "react";
import "./style.css";
import "../../../box-style.css";
import StoryBox from "./StoryBox";
export default function About() {
  return (
    <div className="anchor-box">
      <a name="about" href="/#">
        &nbsp;
      </a>

      <div id="about-container" className="box">
        <h1 id="about-h1">About Me</h1>
        <div id="about-wrapper">
          {/* <img src={mugshot} alt="Selfie of Piper" /> */}

          <input
            type="checkbox"
            id="about-before-box-toggle"
            className="story-box-toggle"
          />
          <label htmlFor="about-before-box-toggle">
            <span className="storybox-toggle-label">Before</span>
          </label>
          <StoryBox storyId="about-before-box" text="" />
          <input type="checkbox" id="about-during-box-toggle" />
          <label htmlFor="about-during-box-toggle">Present</label>
          <StoryBox storyId="about-during-box" text="" />
          <input type="checkbox" id="about-future-box-toggle" />
          <label htmlFor="about-after-box-toggle">After</label>
          <StoryBox storyId="about-after-box" text="" />

          {/* <StoryBox storyId="about-during-box" text="During"/>
          <StoryBox storyId="about-future-box" text="After"/> */}

          {/*  */}
        </div>
      </div>
    </div>
  );
}
